import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
const Header = () => {
  return (
    <header>
      <div className='container'>
        <div className='row space-between'>
          <div className='logo'>
            <Link to='/'>
                <img src={require("../images/ig.png")}/>
                s.honchariuk
                </Link>
          </div>
          <div className='logo'>
            <Link to='/'>More Photos</Link>
          </div>
        </div>
      </div>
    </header>
  );
};

const StyledHeader = styled.header`
    font-size: 16px;
    position: fixed;
    z-index: 99;
    width: 100%;
    font-weight: "700";

    .container {
        .row {
            height: 128px;

            .logo {

                img {
                    height: 25px;
                    margin-bottom: -3.8px;
                    margin-right: 5px;

                }

                a {
                    color: $black;
                    text-decoration: none;
                }
            }

            .menu {
                cursor: pointer;
                border-radius: 100%;
                border: 1px solid $black;
                height: 80px;
                width: 80px;
                display: flex;
                align-items: center;
                justify-content: center;
                transition: 0.3s ease-in-out;

                &:hover {
                    color: $white;
                    background: $black;
                }
            }
        }
    }

`
export default Header;
